INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10001, "ふっふっふ、これでカヤぴぃとボスを見返してやるです！", 1000101, "vo_minigame_1004_top_1_000", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10002, "しりとりでの戦い、お兄さんにも手伝ってもらうです", 1000201, "vo_minigame_1004_top_1_003", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10003, "どんなケンカも売られた以上は買うのが喧嘩屋だ！やってやるぜ！", 1000301, "vo_minigame_1004_top_1_004", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10004, "石板でしりとりか……イノリのヤツおもしろいこと考えるな", 1000401, "vo_minigame_1004_top_1_005", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10005, "しりとりだろうがなんだろうが返り討ちにしてやるぜ", 1000501, "vo_minigame_1004_top_1_006", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10006, "ぐもも……（オデ、ハラヘッタ）", 1000601, "vo_minigame_1004_top_1_007", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10007, "ぐもももも（シリトリ タノシイ）", 1000701, "vo_minigame_1004_top_1_008", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10008, "ぐもももも！（イノリ イイヤツ）", 1000801, "vo_minigame_1004_top_1_009", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10009, "カヤぴぃ相手でも手加減しないです", 1000901, "vo_minigame_1004_top_2_010", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10009, "上等だ！やるからには本気で来いよな", 1000902, "vo_minigame_1004_top_2_011", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10010, "カヤぴぃ、謝るなら今のうちです", 1001001, "vo_minigame_1004_top_2_012", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10010, "イノリこそ泣きを入れるなら今のうちだぜ？", 1001002, "vo_minigame_1004_top_2_013", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10011, "カヤぴぃ、これからは知性の時代ですよ？", 1001101, "vo_minigame_1004_top_2_014", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10011, "待て！オレがバカみたいにいうな！！", 1001102, "vo_minigame_1004_top_2_015", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10012, "さあ、あたしたちの力を見せてやるです", 1001201, "vo_minigame_1004_top_2_016", 1, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10012, "ぐも！（マカセロ！）", 1001202, "vo_minigame_1004_top_2_017", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10013, "よしよし、いいですようまくできたらチョコをあげるです！", 1001301, "vo_minigame_1004_top_2_018", 1, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10013, "ぐも！（オデ チョコスキ）", 1001302, "vo_minigame_1004_top_2_019", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10014, "なあイノリ……もしかして当初の目的見失ってないよな？", 1001401, "vo_minigame_1004_top_2_023", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10014, "もちろん覚えてるですカヤぴぃを倒し我々の知能を証明するです", 1001402, "vo_minigame_1004_top_2_024", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10015, "いくらイノリ相手でも勝ちを譲る気はないからな！", 1001501, "vo_minigame_1004_top_2_025", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10015, "望むところです手加減はなしですよ", 1001502, "vo_minigame_1004_top_2_026", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10016, "へっ、なかなかやるじゃねえか", 1001601, "vo_minigame_1004_top_2_027", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10016, "カヤぴぃも思ったよりやるですね！", 1001602, "vo_minigame_1004_top_2_028", 2, 1, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10017, "お～い、ドラゴンもどき？", 1001701, "vo_minigame_1004_top_2_029", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10017, "ぐもっ！？（ヒッ！）", 1001702, "vo_minigame_1004_top_2_030", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10018, "いやあ、あんときは悪かったなはっはっは", 1001801, "vo_minigame_1004_top_2_031", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10018, "ぐももも……（かやピィ コワカッタ）", 1001802, "vo_minigame_1004_top_2_032", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10019, "お前ってさ……ほんとマヌケな顔してるよな", 1001901, "vo_minigame_1004_top_2_033", 1, 2, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10019, "ぐも……（オマエガ イウカ）", 1001902, "vo_minigame_1004_top_2_034", 2, 3, "vo_minigame_1004");
INSERT INTO `v1_87dd057d83693f2fad97f2724b80390ce93e783616ff5b3ef03f0fd1abc731ea` VALUES (10020, "ぐも……（ハラヘッタ チョコホシイ）", 1002001, "vo_minigame_1004_top_2_044", 2, 3, "vo_minigame_1004");
